// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

contract sender{
//   receive() payable  external {}
    address payable admin;
    mapping (address => uint256) balance;
    uint  amount;
    constructor() {
        admin = payable(msg.sender);
    }
    function deposit(address payable to ,uint amt)  payable  external{
        balance[to] += amt;
    } 
    function getBalance() view public returns (uint256){
        return address(this).balance;

    }
    function transferTo(address payable _to) payable public{
        (bool validation,) =  _to.call {value : msg.value} ('');
        require(validation,"transaction is reverted");
    }
    function getDepositedamt(address payable thatPerson) public  payable returns(uint256){
        return balance[thatPerson];
    }
}
